Da qualche giorno mia figlia è entrata in fissa con la nuova canzone di @elisatoffoli ed ogni volta che la sente, si lascia andare in questa meravigliosa e dolcissima esibizione che voglio condividere con voi. 
Dio quanto ti amo, amore mio. Sei la gioia che monopolizzerà per sempre il mio cuore. 
@mauraian ti somiglia ogni giorno di più, amore 🌹
